import styled from "styled-components";

export const Header = styled.div`

  height: 64px;
  width: 100%;
  position: sticky;
  z-index:100;
  border: 1px solid red;
  background: var(--primary-color);



  &>div{
    background: white;
    padding: 16px 16px 16px 8px;
    align-items: center;
    display: flex;
    height: 100%;
    height: 64px;
    justify-content: space-between;

  }
`;
